import React from 'react'
import { useState } from 'react'

function CounterExample() {
    const [count, setCount] = useState(0)

    return (
        <div>
            <h1>
                {count}
            </h1>
            <h1 onClick = {() => count+1} >
                Add
            </h1>
            <h1 onClick = {() => count-1}> 
                Minus
            </h1>
        </div>
    )
}

export default CounterExample
